export interface Profile {
  id: number;
  name: string;
  age: number;
  height: number;
  weight: number;
  breastSize: number;
  phone: string;
  description: string;
  photos: string[];
  price1Hour: number;
  price2Hours: number;
  priceNight: number;
  priceExpress?: number;
  workingHours?: string;
  isVerified: boolean;
  hasVideo?: boolean;
  hasReviews?: boolean;
  services: string[];
  cityId: number;
  cityIds?: number[];
  district?: string;
  isActive: boolean;
  city?: City;
  cities?: City[];
  createdAt?: string;
  updatedAt?: string;
  verification?: string[];
  outcall?: boolean;
  price?: number;

  // Appearance
  nationality?: string;
  hairColor?: string;
  bikiniZone?: string;

  // Location
  inCall?: boolean;
  outCall?: boolean;

  // Additional filters
  isNonSmoking?: boolean;
  isNew?: boolean;
  isWaitingCall?: boolean;
  is24Hours?: boolean;

  // Neighbors
  isAlone?: boolean;
  withFriend?: boolean;
  withFriends?: boolean;

  // Gender and orientation
  gender: string;
  orientation?: string;
}

export interface City {
  id: number;
  name: string;
  code: string;
}

export interface Language {
  id: number;
  code: string;
  name: string;
}

export interface AppearanceFilters {
  age: [number, number];
  height: [number, number];
  weight: [number, number];
  breastSize: [number, number];
  nationality: string[];
  hairColor: string[];
  bikiniZone: string[];
}

export interface PriceFilters {
  from: number | null;
  to: number | null;
  hasExpress: boolean;
}

export interface FilterParams {
  gender: string[];
  appearance: AppearanceFilters;
  district: string[];
  price: PriceFilters;
  services: Service[];
  verification: string[];
  other: string[];
  outcall: boolean;
}

